CREATE TABLE website_traffic (
    id INT PRIMARY KEY,
    visitor_id INT,
    page_visited VARCHAR(255),
    timestamp TIMESTAMP
);

CREATE TABLE user_interactions (
    id INT PRIMARY KEY,
    user_id INT,
